	</li>
);

const Kickstarterpath = (props) => (
	<Layout>
		<h1>Your Kickstarter pathway</h1>
		<p>Page to display after logged in</p>
		<p>Hi user, welcome to your....</p>
		<PrivateClass title="Hello Private Class" />
		<button>First private class</button>
		<button>5 Public classes</button>
		<button>Assessment private class</button>
	</Layout>
);

export default Kickstarterpath;
